import React, { Component, Fragment } from "react";

import Header from "./Header";

//style
import { AppCss } from "../styles/appCss";

export default class App extends Component {
  render() {
    return (
      <Fragment>
        <Header />
        <AppCss>
          <h1>Hello React Parcel</h1>
        </AppCss>
      </Fragment>
    );
  }
}
